import React from 'react';
import Button from './Button';
import './Navbar.css';
import './Button';

const Navbar = () => {
    return (
        <div className='navBar'>


           <ul> 
               <li><a href='#' className='logo'> MOVISO </a></li>
               <div className='navBarRight'> 
             <li><a href='#'>Home</a></li> 
              <li><a href='#'>Movie</a></li>
              <li><a href='#'>FAQ</a></li>
              <li><a href='#'><Button /></a></li>
              </div>
              </ul>

        </div>

    )
}
export default Navbar
